import {
  Contacts,
  CookiesPolicy,
  Info,
  Teachers,
  What,
  Where,
  Peculiarities,
} from "./components";

const App = () => (
  <>
    <CookiesPolicy />
    <div className="w-screen bg-gray">
      <Info />
      <What />
      <Where />
      <Peculiarities />
      <Teachers />
      <Contacts />
    </div>
  </>
);

export default App;
